"""
Given a non-empty string containing an out-of-order English representation of digits 0-9, output the digits in ascending order.

Note:

Input contains only lowercase English letters.
Input is guaranteed to be valid and can be transformed to its original digits. That means invalid inputs such as "abc" or "zerone" are not permitted.
Input length is less than 50,000.

Example 1:

Input: "owoztneoer"

Output: "012"

Example 2:

Input: "fviefuro"

Output: "45"
"""
import sys
from functools import lru_cache
from collections import Counter
import pytest


class Solution:
    def originalDigits(self, s: str) -> str:
        words = ['zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine']
        key_chars = ['z', 'o', 'w', 'r', 'u', 'f', 'x', 's', 'g', 'i']
        # zero -> eight -> four -> six -> two
        # -> three (-zero -four) -> seven (-six) -> five (-four)
        # -> one (-zero -two -four) -> nine (-one -seven)

        count = [0] * 10
        scnt = Counter(s)
        count[0] = scnt[key_chars[0]]
        count[8] = scnt[key_chars[8]]
        count[4] = scnt[key_chars[4]]
        count[6] = scnt[key_chars[6]]
        count[2] = scnt[key_chars[2]]
        count[3] = scnt[key_chars[3]] - count[0] - count[4]
        count[7] = scnt[key_chars[7]] - count[6]
        count[5] = scnt[key_chars[5]] - count[4]
        count[1] = scnt[key_chars[1]] - count[0] - count[4] - count[2]
        count[9] = scnt[key_chars[9]] - count[5] - count[6] - count[8]

        ret = ''
        for i, c in enumerate(count):
            ret += str(i) * c
        return ret

    def _originalDigits(self, s: str) -> str:
        words = ['zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine']
        chars = sorted(list(''.join(words)))

        def count_chars(s):
            count = Counter(s)
            return [count[c] for c in chars]

        count = count_chars(s)
        word_count = [count_chars(w) for w in words]


        def subtract_list(l1, l2, k):
            ret = []
            valid = True
            for i in range(len(l1)):
                sub = l1[i] - k * l2[i]
                if sub < 0:
                    valid = False
                    return []
                ret.append(sub)
            return ret

        @lru_cache(None)
        def knapsack(cnt):
            if not any(cnt):
                return []
            for i, w in enumerate(word_count):
                sub = subtract_list(cnt, w, 1)
                if not sub:
                    continue
                subresult = knapsack(tuple(sub))
                if isinstance(subresult, list):
                    return [i] + subresult

        return ''.join(map(str, sorted(knapsack(tuple(count)))))


    # ("", "0"),
@pytest.mark.parametrize('s, expected', [
    ("owoztneoer", "012"),
    ("fviefuro", "45"),
    ("nnei", '9'),
    ("zeroonetwothreefourfivesixseveneightnine", "0123456789")
])
def test(s, expected):
    print()
    assert expected == Solution().originalDigits(s)


if __name__ == '__main__':
    sys.exit(pytest.main(["-s", "-v"] + sys.argv))
